import { BrowserRouter, Route, Switch, Link } from 'react-router-dom'

function NavBar() {
    return (
        <>
        <div className="movie-links">
                  <div className="movie-link">
                    <Link to="/movies">New Releases</Link>
                  </div>
                  <div className="movie-link">
                    <Link to="/popmovies">Popular Movies</Link>
                  </div>
                </div>
        </>
    )
}

export default NavBar;
